import { Select } from 'antd';
import 'antd/dist/antd.css';
//import axios from 'axios';
import { useEffect, useState } from 'react';
import { InputNumber } from 'antd';
import { Space } from 'antd';

const { Option } = Select;

const Indicators = ({ setIndicator, setRate }) => {

    const onChangeIndicator = (value) => {
        console.log(`selected ${value}`);
        setIndicator(value)
    }
      
    const onSearchIndicator = (val) => {
        console.log('search:', val);
    }
    
    const onChangeRate = (value) => {
        console.log(`selected ${value}`);
    }
      
      return(
        <div>
            <Space className='indicators'>
                <h1>選擇指標</h1>
                <Select
                showSearch
                style={{ width: 200 }}
                defaultValue={"RSI"}
                onChange={onChangeIndicator}
                onSearch={onSearchIndicator}
                filterOption={(input, option) =>
                    option.children.toLowerCase().indexOf(input.toLowerCase()) >= 0
                }
                >
                <Option value="RSI">RSI</Option>
                <Option value="MACD">MACD</Option>
                <Option value="KD">KD</Option>
                <Option value="三大法人買超">三大法人買超</Option>
                </Select>
                <InputNumber min={0} max={100} defaultValue={3} onChange={onChangeRate} />
            </Space>
        </div>
      );

}



export default Indicators
